import ProfilePhoto from './Profile_Photo.jpg'
import HomePageText from './HomePageText';

function HomePage (){
    return (
    <div className = 'rowA'>
        <img src={ProfilePhoto} alt = 'Will Profile Picture' width = '300' height = '400'/>
        <HomePageText></HomePageText>
    </div>)
}

export default HomePage;
